const Rotas = () => {
  return (
    <BrowserRouter>
      <AuthProvider>
        <Routes>
          <CustomRoute path="/" element={<Home />} />
          <CustomRoute path="/login" element={<Login />} />
          <CustomRoute isPrivate path="/reserva" element={<Reserva />} />
        </Routes>
      </AuthProvider>
    </BrowserRouter>
